description:
Promotional info/Publisher's summary - &quot;What were Archie and the gang like when they were children? Now you can find out! Join Little Archie, Betty, Veronica, Jughead and more in this BIG digital exclusive about some little kids! Even in elementary school, the gang was causing trouble and making everyone laugh. From playing pretend with friends to facing off with the evil Mad Doctor Doom, there's something for everyone in this 150-page Digital Exclusive!&quot;

Thanks to Forsythe-DCP for this great copy. Please seed, and enjoy. 

